import './Card.css';

const DeepTable = ({ e }) => {

  return (
    <>
      <td>{e.position}</td>
      <td>{e.team.name}</td>
      <td>{e.playedGames}</td>
      <td>{e.won}</td>
      <td>{e.draw}</td>
      <td>{e.lost}</td>
      <td>{e.goalsFor}</td>
      <td>{e.goalsAgainst}</td>
      <td>{e.goalDifference}</td>
      <td>{e.points}</td>
    </>
  )
};

export default DeepTable;
